import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { environment } from 'src/environments/environment';
import { UploadModel } from 'src/Models/UploadModel';

@Injectable({
  providedIn: 'root'
})
export class FileService {

  constructor(private http: HttpClient) { }
  baseApiUrl: string = environment.apiURL;

  upload(email: string, file: FormData) {
    const uploadModel = new UploadModel();
    uploadModel.email = JSON.stringify(uploadModel)
    return this.http.post(this.baseApiUrl + "files/upload", uploadModel)
  }

}
